import React from "react";
import './Posts.css'

const Posts = (props) => {
    const {posts} = props

    return (
        <div>
            <h1>POSTS</h1>
            <input></input>
      {  posts.map(post => {
            const {description, location, price, title, _id} = post;
            return <div key={_id} className='Post'>
                    <h3>{title}</h3>
                    <p>{description}</p>
                    <p><strong>Price:</strong> {price}</p>
                    <p><strong>Location:</strong> {location}</p>
                   </div>
        })}
        </div>
    )
}

export default Posts;
